import React,{Component} from 'react';
import './css/navbar.css';
import backpic from './images/backpic.jpg'
class Message extends Component
{

    constructor()
    {
        super()
        this.state={
            message: 'Hello All! Visiting here first time?'
        }
    }

    changeMessage()
    {
        this.setState({
            message:'Scroll down to know my journey '
        })
    }

    render()
    {
        return (
        <div>
             <div style={{backgroundImage:`url(${backpic})`}}>
                <nav>
                    
                    <a href = "#"><pre class="tab1">Intro</pre></a>
                    <a href = "#"><pre class="tab1">Skills</pre></a> 
                    <a href = "#"><pre class="tab1">Projects</pre></a>  
                    <a href = "#"><pre class="tab1">Hobbies</pre></a>  
                    <a href = "#"><pre class="tab1">Contact</pre></a>  
                </nav>
                <h2>{this.state.message}</h2>
                <button onClick={() => this.changeMessage()}>Yes!</button>
            </div>


        </div>
        )
    }
}

export default Message;
